var Global = function () {
	var addMember = function(){
		controller = new ScrollMagic.Controller();
		scene = new ScrollMagic.Scene({ triggerElement: "#footer", triggerHook: 'onEnter', offset: 100})
			.setTween(
				TweenLite.to('#footer .member', .5, {y: 0, ease: Power3.easeOut})
			)
			// .addIndicators()
			.addTo(controller)
	}
	var init = function(){
		addMember()
	};
	return {
		init: function () {
			init();
		}
	};
}();

$(document).ready(function(){
    Global.init()
})
var Index = function () {
	return {
		init: function () {
			new Vue({
				el: '#main',
				data: {
					updateTime: '',
					newsTitle: '',
                    newsLink: '',
                    newConfirmed: 0,
                    newDeath: 0,
					dataCSV: [],
					dataMap: [],
					readMore: [],
					dictArrCSV: [],
					handleMap: [],
					dpConfirmed: 0,
					dpDeath: 0
				},
				methods: {
					async fetchNews(){
						try {
							const res = await $.get('https://spreadsheets.google.com/feeds/list/1az3e1HrKoe1kf2oa5AcKcTOd5UP3Sy-zRzc8RvfKJjA/1/public/values?alt=json')
							const data = res.feed.entry
							this.newsTitle = data[0].gsx$title.$t
                            this.newsLink = data[0].gsx$link.$t
                            this.newConfirmed = data[0].gsx$newconfirmed.$t
							this.newDeath = data[0].gsx$newdeath.$t
							
							this.updateTime = data[0].gsx$updatetime.$t
							this.dpConfirmed = data[0].gsx$diamondprincessconfirmed.$t
							this.dpDeath = data[0].gsx$diamondprincessdeath.$t
						} catch(e) {
							console.error(e)
						} finally {
						}
					},
					async fetchRead(){
						try {
							const res = await $.get('https://spreadsheets.google.com/feeds/list/1az3e1HrKoe1kf2oa5AcKcTOd5UP3Sy-zRzc8RvfKJjA/2/public/values?alt=json')
							const data = res.feed.entry
							const items = []
							for(var i in data) {
								let item = {};
								item.category_id = data[i].gsx$categoryid.$t;
								item.category_name = data[i].gsx$categoryname.$t;
								item.title = data[i].gsx$title.$t;
								item.link = data[i].gsx$link.$t;
								item.thumbnail = data[i].gsx$thumbnail.$t;
								items.push(item);
							}
							this.readMore = items
						} catch(e) {
							console.error(e)
						} finally {}
					},
					async fetchCSV(){
						try {
							const res = await $.get('https://spreadsheets.google.com/feeds/list/1az3e1HrKoe1kf2oa5AcKcTOd5UP3Sy-zRzc8RvfKJjA/3/public/values?alt=json')
							const data = res.feed.entry
							const items = [];
							for(var i in data) {
								let item = {};
								item.id = parseInt(data[i].gsx$id.$t);
								item.type = data[i].gsx$type.$t;
								item.name_zh = data[i].gsx$namezh.$t;
								item.confirmed = parseInt(data[i].gsx$confirmed.$t);
								item.death = parseInt(data[i].gsx$death.$t);
								item.note = data[i].gsx$note.$t;
								items.push(item)
							}
							this.dataCSV = items
						} catch(e) {
							console.error(e)
						} finally {
							$('.loading span').text('載入中 [ 1/3 ]')
							const arrCSV = this.dataCSV;
							this.dictArrCSV = arrCSV.reduce((dict, item, index) => {
								let key = item.id
								delete item.id
								dict[key] = item
								return dict
							}, {})
						}
					},
					async fetchMap(){
						try {
							const res = await $.get('data/merged.simplify.json')
							this.dataMap = res.features
						} catch(e) {
							console.error(e)
						} finally {
							TimeLine = new TimelineMax()
								.add(()=>{
									$('.loading span').text('載入中 [ 2/3 ]')
									const dataMap = this.dataMap 
									this.handleMap = dataMap.map(item => {
										var props = item.properties;
										var neid = props.NE_ID;
										if (this.dictArrCSV.hasOwnProperty(neid)) {
											var handleMapItem = this.dictArrCSV[neid];
											Object.assign(props, handleMapItem);
										}
										return item;
									})
								}, .5)
								.add(()=>{
									$('.loading span').text('載入中 [ 3/3 ]')
									this.initMap()
									this.loadingDone()
                                }, 1)
                                .add(()=>{
                                    window.scrollTo(0, 0)
                                })
						}
					},
					initIndex(){
						const winH = $(window).height()
						controller = new ScrollMagic.Controller();
						introTL = new TimelineMax()
							.to('.intro', 1, {alpha: 0, ease: Power3.easeOut}, 0)
							.set('.intro', {className: '+=active'}, .5)
							.set('.intro', {display: 'none'})
						scene = new ScrollMagic.Scene({ triggerElement: ".scene", triggerHook: 'onLeave', duration: winH*1})
							.setPin('.map')
							.setTween(introTL)
							.addTo(controller)
						scene = new ScrollMagic.Scene({ triggerElement: ".statistic", triggerHook: 'onEnter', offset: 100})
							.setClassToggle(".map .button", "active")
							.setTween(
								TweenLite.to('.map .button', .5, {alpha: 0})
							)
							.addTo(controller)
						TweenLite.from('.loading .container', 1, {alpha: 0, ease: Power3.easeOut})
					},
					initMap(){
						var map = L.map('leaflet').setView([33.798544, 103.844217], 4)
                        map.scrollWheelZoom.disable()
                        map.doubleClickZoom.disable()
						L.tileLayer('', {
							attribution: '',
							maxZoom: 6,
							minZoom: 2,
							noWrap: true
						}).addTo(map);

						var LeafIcon = L.Icon.extend({
							options: {
								iconSize: [35, 35],
							}
						});
						var icon = new LeafIcon({iconUrl: 'img/ferry.svg'});
						L.marker([34.548471, 139.653540], {icon: icon}).addTo(map).bindPopup('<h6>鑽石公主號</h6><div class="confirmed">確診 '+this.dpConfirmed+' 例</div><div class="death">死亡 '+this.dpDeath+' 例</div><div class="note"></div>')

						var info = L.control();
						info.onAdd = function (map) {
							this._div = L.DomUtil.create('div', 'info');
							this.update();
							return this._div;
						};
						info.update = function (props) {
							this._div.innerHTML = (props ? '<h6>' + props.name_zh + '</h6><div class="confirmed">確診 ' + props.confirmed + ' 例</div><div class="death">死亡 ' + props.death + ' 例</div><div class="note">' + props.note + '</div>' : '');
						};
						info.addTo(map);

						var geojson;
						geojson = L.geoJson(this.handleMap, {
							style: (feature)=>{
								return {
									weight: 1,
									opacity: 1,
									color: '#5b5b5b',
									fillOpacity: 1,
									fillColor: getColor(feature.properties.confirmed)
								};
							},
							onEachFeature: (feature, layer)=>{
								if (L.Browser.touch){
									layer.on({
										mousedown: (e)=>{
											var layer = e.target;
											layer.setStyle({
												weight: 2,
												color: '#000000'
											});
											if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
												layer.bringToFront();
											}
											if(feature.properties.confirmed !== 0){
												infoDisplay(true)
												info.update(feature.properties)
											} else {
												infoDisplay(false)
											}
										},
										mouseup: (e)=>{
											infoDisplay(false)
											geojson.resetStyle(e.target);
											info.update();
										}
									})
								} else {
									layer.on({
										mouseover: (e)=>{
											var layer = e.target;
											layer.setStyle({
												weight: 2,
												color: '#000000'
											});
											if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
												layer.bringToFront();
											}
											if(feature.properties.confirmed !== 0){
												infoDisplay(true)
												info.update(feature.properties)
											} else {
												infoDisplay(false)
											}
										},
										mouseout: (e)=>{
											infoDisplay(false)
											geojson.resetStyle(e.target);
											info.update();
										}
									});
								}
							}
						}).addTo(map);

						function getColor(num) {
							return num > 2999 ? '#350000' :
								   num > 999  ? '#600000' :
								   num > 499  ? '#910000' :
								   num > 199  ? '#d32f2f' :
								   num > 99   ? '#f95050' :
								   num > 29   ? '#ff7373' :
								   num > 0    ? '#ffabab' :
												'#9B9B9B'
						}
						function infoDisplay(boolean){
							var $info = $('.info.leaflet-control'),
								$leaflet = $('.leaflet-overlay-pane');
					
							if(boolean){
								TweenLite.to($info, .2, {alpha: 1, scale: 1});
								if (L.Browser.touch){
									$leaflet.bind('mousedown', (e)=>{
										TweenLite.set($info, {x: e.clientX - 50, y: e.clientY - 175 });
									})
								} else {
									$leaflet.bind('mousemove', (e)=>{
										TweenLite.to($info, .2, {x: e.clientX, y: e.clientY });
									})
								}
								
							} else {
								$leaflet.unbind('mousemove')
								TweenLite.to($info, .2, {alpha: 0, scale: 0});
							}
						}
						infoDisplay(false)
					},
					mapButton(){
						TweenLite.to(window, 1, {scrollTo:".statistic", autoKill: false, ease: Power3.easeInOut});
					},
					loadingDone(){
						TimeLine = new TimelineMax()
							.to('.loading .container', 1, {alpha: 0, ease: Power3.easeIn})
							.to('.loading', 1, {alpha: 0, ease: Power3.easeIn}, 1)
							.set('.loading', {'display': 'none'}, 2)
					}
				},
				computed: {
					groupByCategory(){
						return _.chain(this.readMore)
								.groupBy('category_name')
								.value()
					},
					groupByType(){
						return _.chain(this.dataCSV)
								.filter(item => item.confirmed !== 0)
								.orderBy('confirmed', 'desc')
								.groupBy('type')
								.value()
					}
				},
				filters: {
					sumData(array, target){
						let sum = 0
						for(let i in array){
							if(target === 'confirmed'){
								sum += array[i].confirmed;
							} else if(target === 'death'){
								sum += array[i].death;
							}
						}
						return sum
					},
					formateTime(val){
						return moment(String(val)).format('YYYY-MM-DD HH:mm:ss')
					},
					groupName(val){
						return val === 'china' ? '中國大陸境內' :
							   val === 'world' ? '中國大陸境外' :
							   		   ''
					}
				},
				created(){
					this.fetchNews()
					this.fetchRead()
					this.fetchCSV()
					this.fetchMap()
				},
				mounted(){
					this.initIndex()
				}
			})
		}
	};
}();